tarting import','6.11'),(859,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Error importing interface translations','6.11'),(860,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Processing','6.12'),(861,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Initializing.','6.12'),(862,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Remaining @remaining of @total.','6.12'),(863,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','An error has occurred.','6.12'),(864,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Unpublish comment','6.12'),(865,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Unpublish comment containing keyword(s)','6.12'),(866,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Publish post','6.12'),(867,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Unpublish post','6.12'),(868,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Make post sticky','6.12'),(869,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Make post unsticky','6.12'),(870,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Promote post to front page','6.12'),(871,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Remove post from front page','6.12'),(872,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Change the author of a post','6.12'),(873,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Save post','6.12'),(874,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Unpublish post containing keyword(s)','6.12'),(875,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Display a message to the user','6.12'),(876,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Send e-mail','6.12'),(877,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Redirect to URL','6.12'),(878,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Block current user','6.12'),(879,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Ban IP address of current user','6.12'),(880,'/linnaeus_ng/nl/admin/build/modules/list/confirm','default','Please continue to <a href=\"@error_url\">the error page</a>','6.12'),(881,'/linnaeus_ng/nl/batch?op=start&id=4','default','Access denied','6.11'),(882,'/linnaeus_ng/nl/batch?op=start&id=4','default','You are not authorized to access this page.','6.11'),(883,'/linnaeus_ng/nl','default','<h1 class=\"title\">Welcome to your new Drupal website!</h1><p>Please follow these steps to set up and start using your website:</p>','6.11'),(884,'/linnaeus_ng/nl','default','<strong>Configure your website</strong> Once logged in, visit the <a href=\"@admin\">administration section</a>, where you can <a href=\"@config\">customize and configure</a> all aspects of your website.','6.11'),(885,'/linnaeus_ng/nl','default','<strong>Enable additional functionality</strong> Next, visit the <a href=\"@modules\">module list</a> and enable features which suit your specific needs. You can find additional modules in the <a href=\"@download_modules\">Drupal modules download section</a>.','6.11'),(886,'/linnaeus_ng/nl','default','<strong>Customize your website design</strong> To change the \"look and feel\" of your website, visit the <a href=\"@themes\">themes section</a>. You may choose from one of the included themes or download additional themes from the <a href=\"@download_themes\">Drupal themes download section</a>.','6.11'),(887,'/linnaeus_ng/nl','default','<strong>Start posting content</strong> Finally, you can <a href=\"@content\">create content</a> for your website. This message will disappear once you have promoted a post to the front page.','6.11'),(888,'/linnaeus_ng/nl','default','For more information, please refer to the <a href=\"@help\">help section</a>, or the <a href=\"@handbook\">online Drupal handbooks</a>. You may also post at the <a href=\"@forum\">Drupal forum</a>, or view the wide range of <a href=\"@support\">other support options</a> available.','6.11'),(889,'/linnaeus_ng/nl/user/login','default','Sorry, unrecognized username or password. <a href=\"@password\">Have you forgotten your password?</a>','6.11'),(890,'/linnaeus_ng/nl/admin/content/node','default','status','6.12'),(891,'/linnaeus_ng/nl/admin/content/node','default','published','6.12'),(892,'/linnaeus_ng/nl/admin/content/node','default','not published','6.12'),(893,'/linnaeus_ng/nl/admin/content/node','default','promoted','6.12'),(894,'/linnaeus_ng/nl/admin/content/node','default','not promoted','6.12'),(895,'/linnaeus_ng/nl/admin/content/node','default','sticky','6.12'),(896,'/linnaeus_ng/nl/admin/content/node','default','not sticky','6.12'),(897,'/linnaeus_ng/nl/admin/content/node','default','Up to date translation','6.12'),(898,'/linnaeus_ng/nl/admin/content/node','default','Outdated translation','6.12'),(899,'/linnaeus_ng/nl/admin/content/node','default','type','6.12'),(900,'/linnaeus_ng/nl/admin/content/node','default','category','6.12'),(901,'/linnaeus_ng/nl/admin/content/node','default','Language neutral','6.12'),(902,'/linnaeus_ng/nl/admin/content/node','default','language','6.12'),(903,'/linnaeus_ng/nl/admin/content/node','default','Show only items where','6.12'),(904,'/linnaeus_ng/nl/admin/content/node','default','Update options','6.12'),(905,'/linnaeus_ng/nl/admin/content/node','default','Publish','6.12'),(906,'/linnaeus_ng/nl/admin/content/node','default','Unpublish','6.12'),(907,'/linnaeus_ng/nl/admin/content/node','default','Promote to front page','6.12'),(908,'/linnaeus_ng/nl/admin/content/node','default','Demote from front page','6.12'),(909,'/linnaeus_ng/nl/admin/content/node','default','Make sticky','6.12'),(910,'/linnaeus_ng/nl/admin/content/node','default','Remove stickiness','6.12'),(911,'/linnaeus_ng/nl/admin/content/node','default','Update','6.12'),(912,'/linnaeus_ng/nl/admin/content/node','default','updated','6.11'),(913,'/linnaeus_ng/nl/admin/content/node','default','is','6.12'),(914,'/linnaeus_ng/nl/admin/content/node','default','Author','6.12'),(915,'/linnaeus_ng/nl/admin/content/node','default','Status','6.12'),(916,'/linnaeus_ng/nl/admin/content/node','default','The node module manages content on your site, and stores all posts (regardless of type) as a \"node\". In addition to basic publishing settings, including whether the post has been published, promoted to the site front page, or should remain present (or sticky) at the top of lists, the node module also records basic information about the author of a post. Optional revision control over edits is available. For additional functionality, the node module is often extended by other modules.','6.12'),(917,'/linnaeus_ng/nl/admin/content/node','default','Though each post on your site is a node, each post is also of a particular <a href=\"@content-type\">content type</a>. <a href=\"@content-type\">Content types</a> are used to define the characteristics of a post, including the title and description of the fields displayed on its add and edit pages. Each content type may have different default settings for <em>Publishing options</em> and other workflow controls. By default, the two content types in a standard Drupal installation are <em>Page</em> and <em>Story</em>. Use the <a href=\"@content-type\">content types page</a> to add new or edit existing content types. Additional content types also become available as you enable additional core, contributed and custom modules.','6.12'),(918,'/linnaeus_ng/nl/admin/content/node','default','The administrative <a href=\"@content\">content page</a> allows you to review and manage your site content. The <a href=\"@post-settings\">post settings page</a> sets certain options for the display of posts. The node module makes a number of permissions available for each content type, which may be set by role on the <a href=\"@permissions\">permissions page</a>.','6.12'),(919,'/linnaeus_ng/nl/admin/content/node','default','For more information, see the online handbook entry for <a href=\"@node\">Node module</a>.','6.12'),(920,'/linnaeus_ng/nl/admin/content/node','default','[<a href=\"@link\">more help...</a>]','6.12'),(921,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','Show summary in full view','6.12'),(922,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','More information about formatting options','6.12'),(923,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','Input format','6.12'),(924,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','HTML filter','6.12'),(925,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','Line break converter','6.12'),(926,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','URL filter','6.12'),(927,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','HTML corrector','6.12'),(928,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','Web page addresses and e-mail addresses turn into links automatically.','6.12'),(929,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','Allowed HTML tags: @tags','6.12'),(930,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','Lines and paragraphs break automatically.','6.12'),(931,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','PHP evaluator','6.12'),(932,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','You may post PHP code. You should include &lt;?php ?&gt; tags.','6.12'),(933,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','Revision information','6.12'),(934,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','Create new revision','6.12'),(935,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','Log message','6.12'),(936,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode'