'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','disabled','6.12'),(954,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','Parent item','6.12'),(955,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','The maximum depth for an item and all its children is fixed at !maxdepth. Some menu items may not be available as parents if selecting them would exceed this limit.','6.12'),(956,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','Optional. In the menu, the heavier items will sink and the lighter items will be positioned nearer the top.','6.12'),(957,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','URL path settings','6.12'),(958,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','Optionally specify an alternative URL by which this node can be accessed. For example, type \"about\" when writing an about page. Use a relative path and don\'t add a trailing slash or the URL alias won\'t work.','6.12'),(959,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','Changes made to the attachments are not permanent until you save this post. The first \"listed\" file will be included in RSS feeds.','6.12'),(960,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','Attach new file','6.12'),(961,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','KB','6.12'),(962,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','MB','6.12'),(963,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','@size @suffix','6.12'),(964,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','The maximum upload size is %filesize. Only files with the following extensions may be uploaded: %extensions. ','6.12'),(965,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','Attach','6.12'),(966,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','Please wait...','6.12'),(967,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','Track','6.12'),(968,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','view','6.12'),(969,'/linnaeus_ng/nl/node/53/edit?destination=admin%2Fcontent%2Fnode','default','@type %title has been updated.','6.12'),(970,'/linnaeus_ng/nl/admin/build/modules','default','A boolean indicating whether this translation needs to be updated.','6.12'),(971,'/linnaeus_ng/nl/admin/settings/language','default','Left to right','6.11'),(972,'/linnaeus_ng/nl/admin/settings/language','default','Code','6.11'),(973,'/linnaeus_ng/nl/admin/settings/language','default','English name','6.11'),(974,'/linnaeus_ng/nl/admin/settings/language','default','Native name','6.11'),(975,'/linnaeus_ng/nl/admin/settings/language','default','Direction','6.11'),(976,'/linnaeus_ng/nl/admin/settings/language','default','Language negotiation','6.11'),(977,'/linnaeus_ng/nl/admin/settings/language','default','Multilingual system','6.11'),(978,'/linnaeus_ng/nl/admin/settings/language','default','Configure extended options for multilingual content and translations.','6.11'),(979,'/linnaeus_ng/nl/admin/settings/language','default','Add language','6.11'),(980,'/linnaeus_ng/nl/admin/settings/language','default','Configure','6.11'),(981,'/linnaeus_ng/nl/admin/settings/language','default','Icons','6.11'),(982,'/linnaeus_ng/nl/admin/settings/language','default','This page provides an overview of your site\'s enabled languages. If multiple languages are available and enabled, the text on your site interface may be translated, registered users may select their preferred language on the <em>My account</em> page, and site authors may indicate a specific language when creating posts. The site\'s default language is used for anonymous visitors and for users who have not selected a preferred language.','6.11'),(983,'/linnaeus_ng/nl/admin/settings/language','default','For each language available on the site, use the <em>edit</em> link to configure language details, including name, an optional language-specific path or domain, and whether the language is natively presented either left-to-right or right-to-left. These languages also appear in the <em>Language</em> selection when creating a post of a content type with multilingual support.','6.11'),(984,'/linnaeus_ng/nl/admin/settings/language','default','Use the <a href=\"@add-language\">add language page</a> to enable additional languages (and automatically import files from a translation package, if available), the <a href=\"@search\">translate interface page</a> to locate strings for manual translation, or the <a href=\"@import\">import page</a> to add translations from individual <em>.po</em> files. A number of contributed translation packages containing <em>.po</em> files are available on the <a href=\"@translations\">Drupal.org translations page</a>.','6.11'),(985,'/linnaeus_ng/nl/admin/settings/language','default','<strong>Warning</strong>: Changing the default language may have unwanted effects on string translations. Read more about <a href=\"@i18nstrings-help\">String translation</a>','6.11'),(986,'/linnaeus_ng/nl/admin/settings/language/edit/nl','default','Edit language','6.11'),(987,'/linnaeus_ng/nl/admin/settings/language/edit/nl','default','Language code','6.11'),(988,'/linnaeus_ng/nl/admin/settings/language/edit/nl','default','Language name in English','6.11'),(989,'/linnaeus_ng/nl/admin/settings/language/edit/nl','default','Name of the language in English. Will be available for translation in all languages.','6.11'),(990,'/linnaeus_ng/nl/admin/settings/language/edit/nl','default','Native language name','6.11'),(991,'/linnaeus_ng/nl/admin/settings/language/edit/nl','default','Name of the language in the language being added.','6.11'),(992,'/linnaeus_ng/nl/admin/settings/language/edit/nl','default','Path prefix','6.11'),(993,'/linnaeus_ng/nl/admin/settings/language/edit/nl','default','Language code or other custom string for pattern matching within the path. With language negotiation set to <em>Path prefix only</em> or <em>Path prefix with language fallback</em>, this site is presented in this language when the Path prefix value matches an element in the path. For the default language, this value may be left blank. <strong>Modifying this value will break existing URLs and should be used with caution in a production environment.</strong> <em>Example: Specifying \"deutsch\" as the path prefix for German results in URLs in the form \"www.example.com/deutsch/node\".</em>','6.11'),(994,'/linnaeus_ng/nl/admin/settings/language/edit/nl','default','Language domain','6.11'),(995,'/linnaeus_ng/nl/admin/settings/language/edit/nl','default','Language-specific URL, with protocol. With language negotiation set to <em>Domain name only</em>, the site is presented in this language when the URL accessing the site references this domain. For the default language, this value may be left blank. <strong>This value must include a protocol as part of the string.</strong> <em>Example: Specifying \"http://example.de\" or \"http://de.example.com\" as language domains for German results in URLs in the forms \"http://example.de/node\" and \"http://de.example.com/node\", respectively.</em>','6.11'),(996,'/linnaeus_ng/nl/admin/settings/language/edit/nl','default','Direction that text in this language is presented.','6.11'),(997,'/linnaeus_ng/nl/admin/settings/language/edit/nl','default','Right to left','6.11'),(998,'/linnaeus_ng/nl/admin/settings/language/edit/nl','default','Save language','6.11'),(999,'/linnaeus_ng/nl/admin/settings/language/i18n','default','Content selection','6.11'),(1000,'/linnaeus_ng/nl/admin/settings/language/i18n','default','Content selection mode','6.11'),(1001,'/linnaeus_ng/nl/admin/settings/language/i18n','default','Current language and language neutral.','6.11'),(1002,'/linnaeus_ng/nl/admin/setti