aeus_ng/nl/admin/content/types','default','Below is a list of all the content types on your site. All posts that exist on your site are instances of one of these content types.','6.11'),(1017,'/linnaeus_ng/nl/admin/content/node-type/page','default','Identification','6.11'),(1018,'/linnaeus_ng/nl/admin/content/node-type/page','default','The human-readable name of this content type. This text will be displayed as part of the list on the <em>create content</em> page. It is recommended that this name begin with a capital letter and contain only letters, numbers, and <strong>spaces</strong>. This name must be unique.','6.11'),(1019,'/linnaeus_ng/nl/admin/content/node-type/page','default','The machine-readable name of this content type. This text will be used for constructing the URL of the <em>create content</em> page for this content type. This name must contain only lowercase letters, numbers, and underscores. Underscores will be converted into hyphens when constructing the URL of the <em>create content</em> page. This name must be unique.','6.11'),(1020,'/linnaeus_ng/nl/admin/content/node-type/page','default','A brief description of this content type. This text will be displayed as part of the list on the <em>create content</em> page.','6.11'),(1021,'/linnaeus_ng/nl/admin/content/node-type/page','default','Submission form settings','6.11'),(1022,'/linnaeus_ng/nl/admin/content/node-type/page','default','Body field label','6.11'),(1023,'/linnaeus_ng/nl/admin/content/node-type/page','default','To omit the body field for this content type, remove any text and leave this field blank.','6.11'),(1024,'/linnaeus_ng/nl/admin/content/node-type/page','default','Minimum number of words','6.11'),(1025,'/linnaeus_ng/nl/admin/content/node-type/page','default','The minimum number of words for the body field to be considered valid for this content type. This can be useful to rule out submissions that do not meet the site\'s standards, such as short test posts.','6.11'),(1026,'/linnaeu