type/page','default','The default sorting for new users and anonymous users while viewing comments. These users may change their view using the comment control panel. For registered users, this change is remembered as a persistent user preference.','6.11'),(1044,'/linnaeus_ng/nl/admin/content/node-type/page','default','Default comments per page','6.11'),(1045,'/linnaeus_ng/nl/admin/content/node-type/page','default','Default number of comments for each page: more comments are distributed in several pages.','6.11'),(1046,'/linnaeus_ng/nl/admin/content/node-type/page','default','Comment controls','6.11'),(1047,'/linnaeus_ng/nl/admin/content/node-type/page','default','Display above the comments','6.11'),(1048,'/linnaeus_ng/nl/admin/content/node-type/page','default','Display below the comments','6.11'),(1049,'/linnaeus_ng/nl/admin/content/node-type/page','default','Display above and below the comments','6.11'),(1050,'/linnaeus_ng/nl/admin/content/node-type/page','default','Do not display','6.11'),(1051,'/linnaeus_ng/nl/admin/content/node-type/page','default','Position of the comment controls box. The comment controls let the user change the default display mode and display order of comments.','6.11'),(1052,'/linnaeus_ng/nl/admin/content/node-type/page','default','Anonymous commenting','6.11'),(1053,'/linnaeus_ng/nl/admin/content/node-type/page','default','Anonymous posters may not enter their contact information','6.11'),(1054,'/linnaeus_ng/nl/admin/content/node-type/page','default','Anonymous posters may leave their contact information','6.11'),(1055,'/linnaeus_ng/nl/admin/content/node-type/page','default','Anonymous posters must leave their contact information','6.11'),(1056,'/linnaeus_ng/nl/admin/content/node-type/page','default','This option is enabled when anonymous users have permission to post comments on the <a href=\"@url\">permissions page</a>.','6.11'),(1057,'/linnaeus_ng/nl/admin/content/node-type/page','default','Comment subject field','6.11'),(1058,'/linnae