'),(1070,'/linnaeus_ng/nl/admin/content/node-type/page','default','Extended language support','6.11'),(1071,'/linnaeus_ng/nl/admin/content/node-type/page','default','Normal - All enabled languages will be allowed.','6.11'),(1072,'/linnaeus_ng/nl/admin/content/node-type/page','default','Extended - All defined languages will be allowed.','6.11'),(1073,'/linnaeus_ng/nl/admin/content/node-type/page','default','Extended, but not displayed - All defined languages will be allowed for input, but not displayed in links.','6.11'),(1074,'/linnaeus_ng/nl/admin/content/node-type/page','default','If enabled, all defined languages will be allowed for this content type in addition to only enabled ones. This is useful to have more languages for content than for the interface.','6.11'),(1075,'/linnaeus_ng/nl/admin/content/node-type/page','default','Synchronize translations','6.11'),(1076,'/linnaeus_ng/nl/admin/content/node-type/page','default','Select which fields to synchronize for all translations of this content type.','6.11'),(1077,'/linnaeus_ng/nl/admin/content/node-type/page','default','Standard node fields.','6.11'),(1078,'/linnaeus_ng/nl/admin/content/node-type/page','default','Promote','6.11'),(1079,'/linnaeus_ng/nl/admin/content/node-type/page','default','Moderate','6.11'),(1080,'/linnaeus_ng/nl/admin/content/node-type/page','default','Sticky','6.11'),(1081,'/linnaeus_ng/nl/admin/content/node-type/page','default','Revision (Create also new revision for translations)','6.11'),(1082,'/linnaeus_ng/nl/admin/content/node-type/page','default','Book outline (with the translated parent)','6.11'),(1083,'/linnaeus_ng/nl/admin/content/node-type/page','default','Taxonomy terms','6.11'),(1084,'/linnaeus_ng/nl/admin/content/node-type/page','default','Manage fields','6.11'),(1085,'/linnaeus_ng/nl/admin/content/node-type/page','default','Display fields','6.11'),(1086,'/linnaeus_ng/nl/admin/content/node-type/page','default','The content type %name has been updated.','6.11'),(1087,'/linnaeus_ng/nl/admin/user/login_destination','default','URL destination settings','6.11'),(1088,'/linnaeus_ng/nl/admin/user/login_destination','default','This is to specify where exactly user should be redirected upon login.','6.11'),(1089,'/linnaeus_ng/nl/admin/user/login_destination','default','Preserve destination','6.11'),(1090,'/linnaeus_ng/nl/admin/user/login_destination','default','If checked, \'destination=\' parameter specified in the URL will be used to perform redirection. Otherwise, redirection will be always performed according to the settings below.','6.11'),(1091,'/linnaeus_ng/nl/admin/user/login_destination','default','Static URL','6.11'),(1092,'/linnaeus_ng/nl/admin/user/login_destination','default','PHP snippet (experts only)','6.11'),(1093,'/linnaeus_ng/nl/admin/user/login_destination','default','URL','6.11'),(1094,'/linnaeus_ng/nl/admin/user/login_destination','default','<b>Static URL mode:</b> Enter a static path. Example paths are %ex1 or %ex2.','6.11'),(1095,'/linnaeus_ng/nl/admin/user/login_destination','default','<b>PHP snippet mode:</b> Enter PHP code to evaluate path (<b>NO %php tags!</b>). It should return either a string value or an <b>array(\'path\' => path/alias to redirect, \'query\' => parameters, ... [other parameters are equal to the url() function specification]</b>).','6.11'),(1096,'/linnaeus_ng/nl/admin/user/login_destination','default','Redirection condition settings','6.11'),(1097,'/linnaeus_ng/nl/admin/user/login_destination','default','Set the condition to determine whether redirection should happen or not.','6.11'),(1098,'/linnaeus_ng/nl/admin/user/login_destination','default','Always','6.12'),(1099,'/linnaeus_ng/nl/admin/user/login_destination','default','List of paths','6.11'),(1100,'/linnaeus_ng/nl/admin/user/login_destination','default','Redirect condition','6.11'),(1101,'/linnaeus_ng/nl/admin/user/login_destination','default','<b>Always:</b> Redirection happens always. Redirect condition field is ignored.','6.11'),(1102,'/linnaeus_ng/nl/admin/user/login_destination','default','<b>List of paths mode:</b> Enter a list of paths, one path per one line. Redirection will happen only when logging from specified pages. Example paths are <b>%ex1</b> or <b>%ex2</b>.','6.11'),(1103,'/linnaeus_ng/nl/admin/user/login_destination','default','<b>PHP snippet mode:</b> Enter PHP code to find should redirection happen or not (<b>NO %php tags!</b>). It should return boolean value.','6.11'),(1104,'/linnaeus_ng/nl/sites/all/flex/main.html','default','Page not found','6.12'),(1105,'/linnaeus_ng/nl/sites/all/flex/main.html','default','The requested page could not be found.','6.12'),(1106,'/linnaeus_ng/nl/admin/build/menu','default','List menus','6.11'),(1107,'/linnaeus_ng/nl/admin/build/menu','default','Add menu','6.11'),(1108,'/linnaeus_ng/nl/admin/build/menu','default','Settings','6.12'),(1109,'/linnaeus_ng/nl/admin/build/menu','default','Menus are a collection of links (menu items) used to navigate a website. The menus currently available on your site are displayed below. Select a menu from this list to manage its menu items.','6.11'),(1110,'/linnaeus_ng/nl/admin/build/menu','default','The menu module provides an interface to control and customize Drupal\'s powerful menu system. Menus are a hierarchical collection of links, or menu items, used to navigate a website, and are positioned and displayed using Drupal\'s flexible block system. By default, three menus are created during installation: <em>Navigation</em>, <em>Primary links</em>, and <em>Secondary links</em>. The <em>Navigation</em> menu contains most links necessary for working with and navigating your site, and is often displayed in either the left or right sidebar. Most Drupal themes also provide support for <em>Primary links</em> and <em>Secondary links</em>, by displaying them in either the header or footer of each page. By default, <em>Primary links</em> and <em>Secondary links</em> contain no menu items but may be configured to contain custom menu items specific to your site.','6.11'),(1111,'/linnaeus_ng/nl/admin/build/menu','default','The <a href=\"@menu\">menus page</a> displays all menus currently available on your site. Select a menu from this list to add or edit a menu item, or to rearrange items within the menu. Create new menus using the <a href=\"@add-menu\">add menu page</a> (the block containing a new menu must also be enabled on the <a href=\"@blocks\">blocks administration page</a>).','6.11'),(1112,'/linnaeus_ng/nl/admin/build/menu','default','For more information, see the online handbook entry for <a href=\"@menu\">Menu module</a>.','6.11'),(1113,'/linnaeus_ng/nl/admin/build/menu-customize/primary-links','default','Menu item','6.11'),(1114,'/linnaeus_ng/nl/admin/build/menu-customize/primary-links','default','Expanded','6.11'),(1115,'/linnaeus_ng/nl/admin/build/menu-customize/primary-links','default','List items','6.11'),(1116,'/linnaeus_ng/nl/admin/build/menu-customize/primary-links','default','Add item','6.11'),(1117,'/linnaeus_ng/nl/admin/build/menu-customize/primary-links','default','Edit menu','6.11'),(1118,'/linnaeus_ng/nl/admin/build/menu-customize/primary-links','default','To rearrange menu items, grab a drag-and-drop handle under the <em>Menu item</em> column and drag the items (or group of items) to a new location in the list. (Grab a handle by clicking and holding the mouse while hovering over a handle icon.) Remember that your changes will not be saved until you click the <em>Save configuration</em> button at the bottom of the page.','6.11'),(1119,'/linnaeus_ng/nl/admin/build/menu-customize/primary-links/add','default','Path','6.11'),(1120,'/linnaeus_ng/nl/admin/build/menu-customize/primary-links/add','default','The path this menu item links to. This can be an internal Drupal path such as %add-node or an external URL such as %drupal. Enter %front to link to the front page.','6.11'),(1121,'/linnaeus_ng/nl/admin/build/menu-customize/primary-links/add','default','The link text corres