de-type/species/fields','default','none','6.11'),(1529,'/linnaeus_ng/nl/admin/content/node-type/species/fields','default','- Select a field type -','6.11'),(1530,'/linnaeus_ng/nl/admin/content/node-type/species/fields','default','- Select a widget -','6.11'),(1531,'/linnaeus_ng/nl/admin/content/node-type/species/fields','default','Field name (a-z, 0-9, _)','6.11'),(1532,'/linnaeus_ng/nl/admin/content/node-type/species/fields','default','Type of data to store.','6.11'),(1533,'/linnaeus_ng/nl/admin/content/node-type/species/fields','default','Form element to edit the data.','6.11'),(1534,'/linnaeus_ng/nl/admin/content/node-type/species/fields','default','Group name (a-z, 0-9, _)','6.11'),(1535,'/linnaeus_ng/nl/admin/content/node-type/species/fields','default','Add fields and groups to the content type, and arrange them on content display and input forms.','6.11'),(1536,'/linnaeus_ng/nl/admin/content/node-type/species/fields','default','You can add a field to a group by dragging it below and to the right of the group.','6.11'),(1537,'/linnaeus_ng/nl/admin/content/node-type/species/fields','default','Note: Installing the <a href=\"!adv_help\">Advanced help</a> module will let you access more and better help.','6.11'),(1538,'/linnaeus_ng/nl/admin/content/node-type/species/fields','default','New field','6.11'),(1539,'/linnaeus_ng/nl/admin/content/node-type/species/fields','default','New group','6.11'),(1540,'/linnaeus_ng/nl/admin/content/taxonomy','default','edit vocabulary','6.11'),(1541,'/linnaeus_ng/nl/admin/content/taxonomy','default','list terms','6.11'),(1542,'/linnaeus_ng/nl/admin/content/taxonomy','default','add terms','6.11'),(1543,'/linnaeus_ng/nl/admin/content/taxonomy','default','Add vocabulary','6.11'),(1544,'/linnaeus_ng/nl/admin/content/taxonomy','default','The taxonomy module allows you to categorize your content using both tags and administrator defined terms. It is a flexible tool for classifying content with many advanced features. To begin, create a \'Vocabulary\' to hold one set of terms or tags. You can create one free-tagging vocabulary for everything, or separate controlled vocabularies to define the various properties of your content, for example \'Countries\' or \'Colors\'.','6.11'),(1545,'/linnaeus_ng/nl/admin/content/taxonomy','default','Use the list below to configure and review the vocabularies defined on your site, or to list and manage the terms (tags) they contain. A vocabulary may (optionally) be tied to specific content types as shown in the <em>Type</em> column and, if so, will be displayed when creating or editing posts of that type. Multiple vocabularies tied to the same content type will be displayed in the order shown below. To change the order of a vocabulary, grab a drag-and-drop handle under the <em>Name</em> column and drag it to a new location in the list. (Grab a handle by clicking and holding the mouse while hovering over a handle icon.) Remember that your changes will not be saved until you click the <em>Save</em> button at the bottom of the page.','6.11'),(1546,'/linnaeus_ng/nl/admin/content/taxonomy','default','The taxonomy module allows you to categorize content using various systems of classification. Free-tagging vocabularies are created by users on the fly when they submit posts (as commonly found in blogs and social bookmarking applications). Controlled vocabularies allow for administrator-defined short lists of terms as well as complex hierarchies with multiple relationships between different terms. These methods can be applied to different content types and combined together to create a powerful and flexible method of classifying and presenting your content.','6.11'),(1547,'/linnaeus_ng/nl/admin/content/taxonomy','default','For example, when creating a recipe site, you might want to classify posts by both the type of meal and preparation time. A vocabulary for each allows you to categorize using each criteria independently instead of creating a tag for every possible combination.','6.11'),(1548,'/linnaeus_ng/nl/admin/content/taxonomy','default','Type of Meal: <em>Appetizer, Main Course, Salad, Dessert</em>','6.11'),(1549,'/linnaeus_ng/nl/admin/content/taxonomy','default','Preparation Time: <em>0-30mins, 30-60mins, 1-2 hrs, 2hrs+</em>','6.11'),(1550,'/linnaeus_ng/nl/admin/content/taxonomy','default','Each taxonomy term (often called a \'category\' or \'tag\' in other systems) automatically provides lists of posts and a corresponding RSS feed. These taxonomy/term URLs can be manipulated to generate AND and OR lists of posts classified with terms. In our recipe site example, it then becomes easy to create pages displaying \'Main courses\', \'30 minute recipes\', or \'30 minute main courses and appetizers\' by using terms on their own or in combination with others. There are a significant number of contributed modules which you to alter and extend the behavior of the core module for both display and organization of terms.','6.11'),(1551,'/linnaeus_ng/nl/admin/content/taxonomy','default','Terms can also be organized in parent/child relationships from the admin interface. An example would be a vocabulary grouping countries under their parent geo-political regions. The taxonomy module also enables advanced implementations of hierarchy, for example placing Turkey in both the \'Middle East\' and \'Europe\'.','6.11'),(1552,'/linnaeus_ng/nl/admin/content/taxonomy','default','The taxonomy module supports the use of both synonyms and related terms, but does not directly use this functionality. However, optional contributed or custom modules may make full use of these advanced features.','6.11'),(1553,'/linnaeus_ng/nl/admin/content/taxonomy','default','For more information, see the online handbook entry for <a href=\"@taxonomy\">Taxonomy module</a>.','6.11'),(1554,'/linnaeus_ng/nl/admin/content/taxonomy/edit/vocabulary/1','default','Edit vocabulary','6.11'),(1555,'/linnaeus_ng/nl/admin/content/taxonomy/edit/vocabulary/1','default','The name for this vocabulary, e.g., <em>\"Tags\"</em>.','6.11'),(1556,'/linnaeus_ng/nl/admin/content/taxonomy/edit/vocabulary/1','default','Description of the vocabulary; can be used by modules.','6.11'),(1557,'/linnaeus_ng/nl/admin/content/taxonomy/edit/vocabulary/1','default','Instructions to present to the user when selecting terms, e.g., <em>\"Enter a comma separated list of words\"</em>.','6.11'),(1558,'/linnaeus_ng/nl/admin/content/taxonomy/edit/vocabulary/1','default','Select content types to categorize using this vocabulary.','6.11'),(1559,'/linnaeus_ng/nl/admin/content/taxonomy/edit/vocabulary/1','default','Tags','6.11'),(1560,'/linnaeus_ng/nl/admin/content/taxonomy/edit/vocabulary/1','default','Terms are created by users when submitting posts by typing a comma separated list.','6.11'),(1561,'/linnaeus_ng/nl/admin/content/taxonomy/edit/vocabulary/1','default','Multiple select','6.11'),(1562,'/linnaeus_ng/nl/admin/content/taxonomy/edit/vocabulary/1','default','Allows posts to have more than one term from this vocabulary (always true for tags).','6.11'),(1563,'/linnaeus_ng/nl/admin/content/taxonomy/edit/vocabulary/1','default','At least one term in this vocabulary must be selected when submitting a post.','6.11'),(1564,'/linnaeus_ng/nl/admin/content/taxonomy/edit/vocabulary/1','default','Vocabularies are displayed in ascending order by weight.','6.11'),(1565,'/linnaeus_ng/nl/admin/content/taxonomy/edit/vocabulary/1','default','Disable Batax','6.11'),(1566,'/linnaeus_ng/nl/admin/content/taxonomy/edit/vocabulary/1','default','If checked, this Vocabulary will not use Batax for selecting terms on a node form','6.11'),(1567,'/linnaeus_ng/nl/admin/content/taxonomy/edit/vocabulary/1','default','Multilingual options','6.11'),(1568,'/linnaeus_ng/nl/admin/content/taxonomy/edit/vocabulary/1','default','Translation mode','6.11'),(1569,'/linnaeus_ng/nl/admin/content/taxonomy/edit/vocabulary/1','default','None. No multilingual options for this vocabulary.','6.11'),(1570,'/linnaeus_ng/nl/admi