viamente al sitio y hecho click sobre <em>Seguir conectado</em>. En ese momento, este sitio guardó una \"cookie de sesión\" en su navegador que utiliza para identificarle cada vez que regresa. Ahora mismo, la cookie que su navegador ha proporcionado es incorrecta. Una de las causas de este error puede ser que las cookies de su navegador hayan sido robadas y están siendo utilizadas por alguien más para entrar en este sitio con su perfil de usuario.</p><p> Como precaución, hemos cerrado todas sus sesiones de este sitio. Ahora puede volver a identificarse al sitio.</p>','es',0,0,0),(188,'Falla de Persistent Login: no se pudo insertar (%user, %series, %tok, %expires)','es',0,0,0),(189,'Guarda la informacion de Persistent Login (PL) para los usuarios que hicieron click sobre %Seguir_conectado cuando se conectaron.Si esta informacion se relaciona con cualquier PL cookie de un usuario anonimo seran conectados automaticamente. Vea http://jaspan.com/improved_persistent_login_cookie_best_practice para ver los detalles de como se usa esta tecnica.','es',0,0,0),(190,'Esta columna es para {users}.uid .','es',0,0,0),(191,'Las series long-lived que indentifican las secuencias PL token.','es',0,0,0),(192,'La PL Token de un solo uso.','es',0,0,0),(193,'El dia de expiracion para estas series de tokenes.','es',0,0,0),(194,'Guarda registros anteriores de la tabla {persistent_login} antes de que sean borrados; usado actualmente. Los uid, series, token, y campos de expiracion son copiados verbatim.','es',0,0,0),(195,'Cuando este registro fue copiado de la tabla {persistent_login}.','es',0,0,0),(196,'Provee un checkbox \'Seguir Conectado\' en la forma de acceso.','es',0,0,0),(265,'Zoek','nl',0,0,0);
