INSERT INTO `node_revisions` VALUES (102,102,1,'Panthera pardus','<TEXTFORMAT LEADING=\"2\"><P ALIGN=\"LEFT\"><FONT FACE=\"Verdana\" SIZE=\"10\" COLOR=\"#0B333C\" LETTERSPACING=\"0\" KERNING=\"0\">The <B><I>leopard </I></B>is a member of the Felidae family and the smallest of the four &quot;big cats&quot; in the genus Panthera; the other three are the tiger, lion and jaguar. Once distributed across southern Asia and Africa, from Korea to South Africa, the leopard&apos;s range of distribution has decreased radically over time due to hunting and loss of habitat, and the leopard now chiefly occurs in sub-Saharan Africa. There are fragmented populations in Pakistan, India, Indochina, Malaysia, and China.</FONT></P></TEXTFORMAT>','<TEXTFORMAT LEADING=\"2\"><P ALIGN=\"LEFT\"><FONT FACE=\"Verdana\" SIZE=\"10\" COLOR=\"#0B333C\" LETTERSPACING=\"0\" KERNING=\"0\">The <B><I>leopard </I></B>is a member of the Felidae family and the smallest of the four &quot;big cats&quot; in the genus Panthera; the other three are the tiger, lion and jaguar. Once distributed across southern Asia and Africa, from Korea to South Africa, the leopard&apos;s range of distribution has decreased radically over time due to hunting and loss of habitat, and the leopard now chiefly occurs in sub-Saharan Africa.','',1243374687,1),(103,103,1,'Giraffa camelopardalis','<TEXTFORMAT LEADING=\"2\"><P ALIGN=\"LEFT\"><FONT FACE=\"Verdana\" SIZE=\"10\" COLOR=\"#0B333C\" LETTERSPACING=\"0\" KERNING=\"0\">The giraffe (<B><I>Giraffa camelopardalis</I></B>) is an African even-toed ungulate mammal, the tallest of all land-living animal species, and the largest ruminant. It is covered in large, irregular patches of yellow to black fur separated by white, off-white, or dark yellowish brown background. The average mass for an adult male giraffe is 1,191 kilograms (2,630 lb) while the average mass for an adult female is 828 kilograms (1,830 lb). It is approximately 4.3 metres (14 ft) to 5.2 metres (17 ft) tall, although the tallest male recorded stood almost 6 metres (20 ft).</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING=\"2\"><P ALIGN=\"LEFT\"><FONT FACE=\"Verdana\" SIZE=\"10\" COLOR=\"#0B333C\" LETTERSPACING=\"0\" KERNING=\"0\"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING=\"2\"><P ALIGN=\"LEFT\"><FONT FACE=\"Verdana\" SIZE=\"10\" COLOR=\"#0B333C\" LETTERSPACING=\"0\" KERNING=\"0\">The giraffe is related to deer and cattle, but is placed in a separate family, the Giraffidae, consisting of only the giraffe and its closest relative, the okapi. Its range extends from Chad in Central Africa to South Africa.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING=\"2\"><P ALIGN=\"LEFT\"><FONT FACE=\"Verdana\" SIZE=\"10\" COLOR=\"#0B333C\" LETTERSPACING=\"0\" KERNING=\"0\"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING=\"2\"><P ALIGN=\"LEFT\"><FONT FACE=\"Verdana\" SIZE=\"10\" COLOR=\"#0B333C\" LETTERSPACING=\"0\" KERNING=\"0\">Giraffes usually inhabit savannas, grasslands, or open woodlands. However, when food is scarce they will venture into areas with denser vegetation. They prefer areas with plenty of acacia growth. They will drink large quantities of water when available which enables them to live for extended periods in dry, arid areas.</FONT></P></TEXTFORMAT>','<TEXTFORMAT LEADING=\"2\"><P ALIGN=\"LEFT\"><FONT FACE=\"Verdana\" SIZE=\"10\" COLOR=\"#0B333C\" LETTERSPACING=\"0\" KERNING=\"0\">The giraffe (<B><I>Giraffa camelopardalis</I></B>) is an African even-toed ungulate mammal, the tallest of all land-living animal species, and the largest ruminant. It is covered in large, irregular patches of yellow to black fur separated by white, off-white, or dark yellowish brown background. The average mass for an adult male giraffe is 1,191 kilograms (2,630 lb) while the average mass for an adult female is 828 kilograms (1,830 lb).','',1243596904,1),(100,100,1,'Acinonyx jubatus','<TEXTFORMAT LEADING=\"2\"><P ALIGN=\"LEFT\"><FONT FACE=\"Verdana\" SIZE=\"10\" COLOR=\"#0B333C\" LETTERSPACING=\"0\" KERNING=\"1\">The <B><I><U>cheetah</U></I></B> is an a-typical member of the cat family (Felidae) that is unique in its speed, while lacking climbing abilities. Therefore it is placed in its own genus, Acinonyx. It is the fastest land animal, reaching speeds between 112 and 120 km/h (70 and 75 mph) in short bursts covering distances up to 460 m (1,500 ft), and has the ability to accelerate from 0 to 110 km/h (68 mph) in three seconds, faster than most supercars. Recent studies confirm the cheetah&apos;s status as fastest land animal.</FONT></P></TEXTFORMAT>','<TEXTFORMAT LEADING=\"2\"><P ALIGN=\"LEFT\"><FONT FACE=\"Verdana\" SIZE=\"10\" COLOR=\"#0B333C\" LETTERSPACING=\"0\" KERNING=\"1\">The <B><I><U>cheetah</U></I></B> is an a-typical member of the cat family (Felidae) that is unique in its speed, while lacking climbing abilities. Therefore it is placed in its own genus, Acinonyx. It is the fastest land animal, reaching speeds between 112 and 120 km/h (70 and 75 mph) in short bursts covering distances up to 460 m (1,500 ft), and has the ability to accelerate from 0 to 110 km/h (68 mph) in three seconds, faster than most supercars.','',1244025073,1),(53,53,1,'Linnaeus Next Generation','<iframe src=\"sites/all/flex/LinnaeusNG.html\" width=\"100%\" height=\"600px\" frameborder=\"0\" />','<iframe src=\"sites/all/flex/LinnaeusNG.html\" width=\"100%\" height=\"600px\" frameborder=\"0\" />','',1246279508,2),(101,101,1,'Panthera leo','<TEXTFORMAT LEADING=\"2\"><P ALIGN=\"LEFT\"><FONT FACE=\"Verdana\" SIZE=\"10\" COLOR=\"#0B333C\" LETTERSPACING=\"0\" KERNING=\"0\">The lion is a member of the family Felidae and one of four big cats in the genus Panthera. With some males exceeding 250 kg (550 lb) in weight, it is the second-largest living cat after the tiger. Wild lions currently exist in Sub-Saharan Africa and in Asia with a critically endangered remnant population in northwest India, having disappeared from North Africa, the Middle East, and Western Asia in historic times. Until the late Pleistocene (about 10,000 years ago), the lion was the most widespread large land mammal beside humans.</FONT></P></TEXTFORMAT>','<TEXTFORMAT LEADING=\"2\"><P ALIGN=\"LEFT\"><FONT FACE=\"Verdana\" SIZE=\"10\" COLOR=\"#0B333C\" LETTERSPACING=\"0\" KERNING=\"0\">The lion is a member of the family Felidae and one of four big cats in the genus Panthera. With some males exceeding 250 kg (550 lb) in weight, it is the second-largest living cat after the tiger. Wild lions currently exist in Sub-Saharan Africa and in Asia with a critically endangered remnant population in northwest India, having disappeared from North Africa, the Middle East, and Western Asia in historic times.','',1243369943,1),(56,56,1,'Select language','','','',1242943102,1),(57,57,1,'Linnaeus Project Settings','','','',1243946460,0),(63,63,1,'test','test topic','test topic','',1243194736,1);
