INSERT INTO `search_dataset` VALUES (53,'node',' linnaeus next generation ',1246279508),(56,'node',' select language ',0),(57,'node',' linnaeus project settings wildlife in tanzania a picture key for wildlife in tanzania tanzania is home to more than eighty species of large mammals and other interesting species w addink attribution netherlands identification key introduction classification classic key multimedia species general  ',0),(63,'node',' test test topic  general  ',0),(100,'node',' acinonyx jubatus the cheetah is an atypical member of the cat family felidae that is unique in its speed while lacking climbing abilities therefore it is placed in its own genus acinonyx it is the fastest land animal reaching speeds between 112 and 120 km h 70 and 75 mph in short bursts covering distances up to 460 m 1500 ft and has the ability to accelerate from 0 to 110 km h 68 mph in three seconds faster than most supercars recent studies confirm the cheetah s status as fastest land animal  ',0),(101,'node',' panthera leo the lion is a member of the family felidae and one of four big cats in the genus panthera with some males exceeding 250 kg 550 lb in weight it is the secondlargest living cat after the tiger wild lions currently exist in subsaharan africa and in asia with a critically endangered remnant population in northwest india having disappeared from north africa the middle east and western asia in historic times until the late pleistocene about 10000 years ago the lion was the most widespread large land mammal beside humans  ',0),(102,'node',' panthera pardus the leopard is a member of the felidae family and the smallest of the four big cats in the genus panthera the other three are the tiger lion and jaguar once distributed across southern asia and africa from korea to south africa the leopard s range of distribution has decreased radically over time due to hunting and loss of habitat and the leopard now chiefly occurs in subsaharan africa there are fragmented populations in pakistan india indochina malaysia and china  ',0),(103,'node',' giraffa camelopardalis the giraffe  giraffa camelopardalis  is an african eventoed ungulate mammal the tallest of all landliving animal species and the largest ruminant it is covered in large irregular patches of yellow to black fur separated by white offwhite or dark yellowish brown background the average mass for an adult male giraffe is 1191 kilograms 2630 lb while the average mass for an adult female is 828 kilograms 1830 lb it is approximately 43 metres 14 ft to 52 metres 17 ft tall although the tallest male recorded stood almost 6 metres 20 ft the giraffe is related to deer and cattle but is placed in a separate family the giraffidae consisting of only the giraffe and its closest relative the okapi its range extends from chad in central africa to south africa giraffes usually inhabit savannas grasslands or open woodlands however when food is scarce they will venture into areas with denser vegetation they prefer areas with plenty of acacia growth they will drink large quantities of water when available which enables them to live for extended periods in dry arid areas  ',0);
